	add("livelock", "{\"term\":\"livelock\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027(ca. 1971)\u0027\u0026lt;!-- see http://www.google.ca/search?hl\u003den\u0026amp;tbs\u003dbks:1,cdr:1,cd_min:3%20janv.%201,cd_max:31%20d%C3%A9c.%201971\u0026amp;tbo\u003dp\u0026amp;q\u003dlivelock\u0026amp;num\u003d10 --\u0026gt; {{compound|live|lock|lang\u003den}}; punning antonym for \u0027deadlock\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A condition resembling deadlock in which various computational processes are constantly changing but never reach a point where any of them can proceed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Mark Pearce, \u0027Comprehensive VB .NET Debugging\u0027, ISBN 9781590590508, [http://books.google.ca/books?id\u003dGpQQ2siKXyEC\u0026amp;pg\u003dPA439\u0026amp;dq\u003d%22livelock%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dFEBUUqG5BIPW2gW91oHYDg\u0026amp;ved\u003d0CE8Q6AEwB\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22livelock%22\u0026amp;f\u003dfalse p. 439 (Google preview\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A process is considered to be in a state of \u0027\u0027livelock\u0027\u0027 when thread code is still executing, but two or more threads are in a never-ending cycle with each other and no useful work is being done\", \"priority\":4}]}, \"synonyms\":{}}");

