	add("liverwort", "{\"term\":\"liverwort\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From \u0027lang\u003den\u0027 + Old english (ca. 450-1100) \u0027lang\u003dang|wort\u0027 () from the belief that some species looked like livers and were useful for treating the liver medicinally.{{rfe|this etym makes it look like it was made in modern times by combining a modern word with and Old English word. or were \u0026quot;liver\u0026quot; and \u0026quot;liverwort\u0026quot; also used in Old English?|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of bryophyte (includes mosses, liverworts, and hornworts) with a leafy stem or leafless thallus characterized by a dominant gametophyte stage and a lack of stomata on the sporophyte stage of the life cycle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1929\u0027\u0027 — Shiv Ram Kashyap, \u0027Liverworts of the Western Himalayas and the Panjab Plain\u0027, vol. I, p. 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027liverworts\u0027\u0027 are either thallose, without any differentiation into stem and leaves, or leafy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027 — W. B. Schofield, \u0027Introduction to Bryology\u0027, p. 13\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Since the thallus of some \u0027\u0027liverworts\u0027\u0027 resembled a liver, such plants were considered useful in making a concoction that would aid in curing liver ailments. Hence the name \u0026quot;liver-plant,\u0026quot; or \u0027\u0027liverwort\u0027\u0027. Unfortunately, there is no evidence that \u0027\u0027liverworts\u0027\u0027 possess curative properties\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027 — Barbara Crandall-Stotler \u0026amp; Raymond E. Stotler, \u0026quot;Morphology and classification of the Marchantiophyta\u0026quot;. pages 21-70 \u0027in\u0027 A. Jonathan Shaw \u0026amp; Bernard Goffinet (Eds.), \u0027Bryophyte Biology\u0027, page 21\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Like other bryophytes, \u0027\u0027liverworts\u0027\u0027 are small, herbaceous plants of terrestrial ecosystems\", \"priority\":7}]}, \"synonyms\":{}}");

