	add("livery", "{\"term\":\"livery\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027liveree\u0027 from Old french (842-ca. 1400) \u0027livree\u0027 Compare modern French \u0027livrée\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any distinctive identifying uniform worn by a group, such as the uniform worn by chauffeurs and male servants\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003d“I don\u0027t know how you and the ‘head,’ as you call him, will get on, but I do know that if you call my duds a ‘\u0027\u0027livery\u0027\u0027’ again there\u0027ll be trouble. It\u0027s bad enough to go around togged out like a life saver on a drill day, but I can stand that \u0027cause I\u0027m paid for it. What I won\u0027t stand is to have them togs called a \u0027\u0027livery\u0027\u0027. […]”\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"J. M. Bennet\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"By wearing \u0027\u0027livery\u0027\u0027, the brewers publicly expressed guild association and solidarity\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The paint scheme of a vehicle or fleet of vehicles\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A taxicab or limousine\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The delivery of property from one owner to the next\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The writ by which property is obtained\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The rental of horses or carriages; the rental of canoes; the care and/or boarding of horses for money\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Lowel\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Pegasus does not stand at \u0027\u0027livery\u0027\u0027 even at the largest establishment in Moorfields\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A stable that keeps horses or carriages for rental\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"An allowance of food; a ration, as given out to a family, to servants, to horses, etc\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Cavendis\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The emperor\u0027s officers every night went through the town from house to house whereat any English gentleman did repast or lodge, and served their \u0027\u0027liveries\u0027\u0027 for all night: first, the officers brought into the house a cast of fine manchet [white bread], and of silver two great post, and white wine, and sugar\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Release from wardship; deliverance\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"It concerned them first to sue out their \u0027\u0027livery\u0027\u0027 from the unjust wardship of his encroaching prerogative\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A low grade of wool\", \"priority\":19}]}, \"synonyms\":{}}");

